class Solution {
    public long numberOfPowerfulInt(long start, long finish, int limit, String s) {
        long count = 0;
        // Convert the suffix string to a number for easier comparison
        long suffix = Long.parseLong(s);
        long min = (long) Math.pow(10, s.length() - 1);
        if (suffix < min) {
            return 0; // Suffix does not meet the minimum value requirement
        }

        // Start from the minimum number that can be formed with the suffix
        long current = suffix;
        while (current <= finish) {
            if (current >= start && isValid(current, limit)) {
                count++;
            }
            // Calculate the next number with the suffix within the limit
            long next = nextValid(current, limit, s);
            if (next == current) {
                break;
            }
            current = next;
        }

        return count;
    }

    private boolean isValid(long number, int limit) {
        while (number > 0) {
            if (number % 10 > limit) {
                return false;
            }
            number /= 10;
        }
        return true;
    }

    private long nextValid(long current, int limit, String s) {
        // Generate the next number by adding 1 to the prefix (before the suffix part)
        long increment = (long) Math.pow(10, s.length());
        long next = current + increment;
        // Ensure the next number has all its digits within the limit
        while (next % increment != Long.parseLong(s)) {
            next += increment;
        }
        // Check each digit of the prefix to ensure it is within the limit
        long prefix = next / increment;
        while (prefix > 0) {
            if (prefix % 10 > limit) {
                return current; // If any digit exceeds the limit, stop and return the current number
            }
            prefix /= 10;
        }
        return next;
    }
}
